@hypeart: When it comes to sports photography, there are those who capture game highlights and those who capture a spiritual awakening. Andy Kenutis is distinctly part of the latter camp. In a time when the sports world seeks to bring the real energy back into the stands, we caught up with the Minnesota @vikings photographer to discuss his process as part of our ongoing ‘Through the Lens’ series.⁠⁠
⁠Click the link in our bio to view the full feature.⁠⁠
⁠Photo: @vikingsphotog
